import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Button, Typography, Select, MenuItem } from '@mui/material';
import { useTranslation } from 'react-i18next';

const Navbar = () => {
  const { t, i18n } = useTranslation();

  const handleLanguageChange = (event) => {
    i18n.changeLanguage(event.target.value);
  };

  return (
    <AppBar position="sticky">
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1 }}>
          {t('welcome')}
        </Typography>
        <Button color="inherit" component={Link} to="/">{t('home')}</Button>
        <Button color="inherit" component={Link} to="/shop">{t('shop')}</Button>
        <Button color="inherit" component={Link} to="/about">{t('about')}</Button> {/* Updated path */}
        <Button color="inherit" component={Link} to="/subscription">{t('subscription')}</Button>
        <Button color="inherit" component={Link} to="/login">{t('login')}</Button>
        <Select
          value={i18n.language}
          onChange={handleLanguageChange}
          sx={{ color: 'white', marginLeft: '1rem' }}
        >
          <MenuItem value="en">English</MenuItem>
          <MenuItem value="hi">हिन्दी</MenuItem>
        </Select>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
